import React from "react";
import Flatlist from "../Flatlist";
import "../../map.css";
import "./style.css";

const Hero = (props) => {
   // const {plants}=props;
   const {page}=props;
        {
         switch(page){
            case "home":
               return (
                        <div className="hero-image">
                           <p className="hero-text">Texas Mountain Laurel (<span className="scientific-name">Sophora secundiflora
                              </span>)
                           </p>
                        </div>
                  );
            case "list":
                return (
                        <div id="hero">
                        </div>
                );
            case "profile":
              return (
                     <div id="hero">
                     </div>
               );
               } 
            
         }
};
      
export default Hero;
